import styled from "styled-components";

export const ContributionBox = styled.ul`
  /*
  width: 100%;
  height: 10rem;
  display: flex; */
  border: 1px gray solid;
  display: flex;
  width: 100%;
  height: 10rem;
  flex-direction: column;
  flex-wrap: wrap;

  li {
    display: inline-block;
    width: 0.7rem;
    height: 0.7rem;
    margin: 2px;
    border: 0.2px solid black;
  }
`;
